import ReactDom from 'react-dom'


const lname = "Muhammad Zaeem";
const ldate = new Date().toLocaleDateString();
const ltime = new Date().toLocaleTimeString();


ReactDom.render(
  <>
    <h1>    Hi there, My Name is {lname}   </h1>
    <p> Date : {ldate} </p>
    <p> time : {ltime}  </p>
</>,
document.getElementById("root")
);
